import * as React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";
import { Table } from "./components/Table";
import { Home } from "./components/Home";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/home">
          <Home />
        </Route>
        <Route path="/table">
          <Table />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
